import React from 'react';
/**
* @author
* @function Header
**/

const Header = (props) => {
  return(
    <div className='headertext'>
      <div className="container-fluid">
          <div class="row justify-content-center">
          <div class="col-12 headerText">Documentation</div>
          </div>
      </div>
    </div>
   )
 }

export default Header;
